    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block javascripts %}
    <!--<link rel=\"stylesheet\" href=\"http://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap.min.css\">
    <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/1.12.2/jquery.min.js\"></script>
    <script src=\"http://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/js/bootstrap.min.js\"></script>-->

{%  endblock %}

{% block stylesheets %}
    {{  encore_entry_link_tags('login') }}
{% endblock %}


{% block body %}
    <div class=\"container pt-2 \">
        <div class=\"row\">
            <div class=\" col-md-4 offset-md-4 border rounded\">
                <form method=\"post\" >
                    {% if error %}
                        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
                    {% endif %}

                    {% if app.user %}
                        <div class=\"mb-3\">
                            You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
                        </div>
                    {% endif %}
                    {%  if message is defined %}
                        <div class=\"alert-success mb-3\">
                            <p> {{ message }}</p>
                        </div>
                    {%  endif %}
                    <h1 class=\"h3 mb-3 font-weight-normal\">Please sign in</h1>
                    <label for=\"inputUsername\">Username</label>
                    <input type=\"text\" value=\"{{ last_username }}\" name=\"username\" id=\"inputUsername\" class=\"form-control\" required autofocus><br>
                    <label for=\"inputPassword\">Password</label>
                    <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" required>

                    <input type=\"hidden\" name=\"_csrf_token\"
                           value=\"{{ csrf_token('authenticate') }}\"
                    >

            {#
                Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
                See https://symfony.com/doc/current/security/remember_me.html

                <div class=\"checkbox mb-3\">
                    <label>
                        <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                    </label>
                </div>
            #}

                    <button class=\"btn btn-lg btn-primary pt-2\" type=\"submit\">
                        Sign in
                    </button>

                </form>
                {% if not app.user %}
                <div class=\"sign up\">
                    <p class=\"text-right\"><a  href=\"{{ path( 'app_registration' ) }}\">or Sign up</a></p>
                </div>
                {% endif %}
            </div>
        </div>
    </div>


{% endblock %}


", "security/login.html.twig", "/home/jakub/Downloads/backup-main/templates/security/login.html.twig");
